import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser,faLock,faEnvelope} from '@fortawesome/free-solid-svg-icons';

import {
  CButton,
  CCard,
  CCardBody,
  CCol,
  CContainer,
  CForm,
  CFormInput,
  CInputGroup,
  CInputGroupText,
  CRow,
} from '@coreui/react'
import CIcon from '@coreui/icons-react'
import { cilLockLocked, cilUser } from '@coreui/icons'
import { useFormik } from 'formik';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
<CInputGroupText>
  <FontAwesomeIcon icon={faUser} />
  <FontAwesomeIcon icon={faLock}/>
  <FontAwesomeIcon icon={faEnvelope}/>
</CInputGroupText>

const registerformvalidateion = (values) => {
    const errors = {};

    if(!values.username){
        errors.username ="user name is required"
    }

    if(!values.email){
        errors.email ="password is required"
    }
    if(!values.password){
        errors.password ="password is required"
    }
    if(!values.reenterpassword){
        errors.reenterpassword ="pls Re enter the password is required"
    }
    return errors
}


const Register = () => {

    const apiUrl = "http://localhost:3001";
    const redirect=useNavigate()

    const formik = useFormik({
        initialValues: {
            username:"",
            email:"",
            password:"",
            reenterpassword:"",
        },
        onSubmit: (values) => {
            console.log(values)

            axios.post(`${apiUrl}/register`, values).then((res)=>{
                console.log("success", res)
            }).catch((error)=>{
                console.log("error",error)
            })
            redirect("../")
        },
        validate:registerformvalidateion
    })

  return (
    <div className="bg-light min-vh-100 d-flex flex-row align-items-center">
      <CContainer>
        <CRow className="justify-content-center">
          <CCol md={9} lg={7} xl={6}>
            <CCard className="mx-4">
              <CCardBody className="p-4">
                <CForm onSubmit={formik.handleSubmit}>
                  <h1>Register</h1>
                  <p className="text-medium-emphasis">Create your account</p>
                  <CInputGroup className="mb-3">
                    <CInputGroupText>
                      <CIcon icon={cilUser} />
                      <FontAwesomeIcon icon={faUser} />
                    </CInputGroupText>
                    <CFormInput placeholder="Username" autoComplete="username" name='username' onChange={formik.handleChange} onBlur={formik.handleBlur} />
                    {formik.errors.username && (<div>{formik.errors.username}</div>)}
                  </CInputGroup>
                  <CInputGroup className="mb-3">
                    <CInputGroupText>
                    <FontAwesomeIcon icon={faEnvelope}/>
                    </CInputGroupText>
                    <CFormInput placeholder="Email" autoComplete="email" name='email' onChange={formik.handleChange}/>
                    {formik.errors.email && (<div>{formik.errors.email}</div>)}
                  </CInputGroup>
                  <CInputGroup className="mb-3">
                    <CInputGroupText>
                      <CIcon icon={cilLockLocked} />
                      <FontAwesomeIcon icon={faLock} />
                    </CInputGroupText>
                    <CFormInput
                      type="password"
                      placeholder="Password"
                      autoComplete="new-password"
                      name='password'
                      onChange={formik.handleChange}
                    />
                    {formik.errors.password && (<div>{formik.errors.password}</div>)}
                  </CInputGroup>
                  <CInputGroup className="mb-4">
                    <CInputGroupText>
                      <CIcon icon={cilLockLocked} />
                      <FontAwesomeIcon icon={faLock} />
                    </CInputGroupText>
                    <CFormInput
                      type="password"
                      placeholder="Re-enter password"
                      autoComplete="new-password"
                      name='reenterpassword'
                      onChange={formik.handleChange}
                    />
                    {formik.errors.reenterpassword && (<div>{formik.errors.reenterpassword}</div>)}
                  </CInputGroup>
                  <div className="d-grid">
                    <CButton type='submit' color="success">Create Account</CButton>
                  </div>
                </CForm>
              </CCardBody>
            </CCard>
          </CCol>
        </CRow>
      </CContainer>
    </div>
  )
}

export default Register
